import React from 'react';
import './PaymentMethodSelection.css';

const Fawry = () => {
  return (
    <div className="payment-method-card">
      <h2>Fawry Payment</h2>
      <form>
        <input
          type="text"
          placeholder="Fawry Code"
        />
        <input
          type="text"
          placeholder="Amount"
        />
        <button type="submit" className="payment-btn">
          Confirm Payment
        </button>
      </form>
    </div>
  );
};

export default Fawry;
